	add("enterobiasis", "{\"term\":\"enterobiasis\", \"etymology\":{\"influencers\":[], \"languages\":[\"Spanish\", \"ancient greek (to 1453)\"], \"text\":\"From Enterobius, from {{prefix|entero|bium|lang\u003des}} (these from Ancient greek (to 1453) \u0027ἔντερον\u0027 (intestine) + \u0027βίος\u0027 (life) + {{m|grc|-σις||action, process}}\u0026lt;!-- {{suffix||cito|lang\u003des}}.--\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"infection by \u0027Enterobius\u0027 pinworm\", \"priority\":1}]}, \"synonyms\":{}}");

	add("enterococcus", "{\"term\":\"enterococcus\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|entero|coccus|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a group of streptococci bacteria, of the genus \u0027Enterococcus\u0027, that inhabit the human gastrointestinal tract and have great resistance to antibiotics\", \"priority\":1}]}, \"synonyms\":{}}");

