	add("enterprise", "{\"term\":\"enterprise\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) via Middle english (1100-1500) and Middle french (ca. 1400-1600) \u0027entreprise\u0027 feminine past participle of \u0027entreprendre\u0027 (to undertake) from \u0027entre\u0027 () + \u0027prendre|lang\u003dfro\u0027 () from Latin \u0027inter\u0027 + {{m|la|prehendō}}, see \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A company, business, organization, or other purposeful endeavor\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The wikipedia:government sponsored government sponsored \u0027\u0027enterprises\u0027\u0027 (GSEs) are a group of financial services corporations which have been created by the United States Congress\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A micro-\u0027\u0027enterprise\u0027\u0027 is defined as a business having 5 or fewer employees and a low seed capital\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An undertaking or project, especially a daring and courageous one\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Biosphere 2 was a scientific \u0027\u0027enterprise\u0027\u0027 aimed at the exploration of the complex web of interactions within life systems\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A willingness to undertake new or risky projects; energy and initiative\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He has shown great \u0027\u0027enterprise\u0027\u0027 throughout his early career\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"an active participation in projects\", \"priority\":8}]}, \"synonyms\":{}}");

	add("entertailing", "{\"term\":\"entertailing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|entertaining|retailing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A commercially-designed experience intended to combine entertainment and retailing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Michael R. Solomon, Elnora W. Stuart, \u0027Marketing: real people, real choices\u0027 (page 420\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Begelman\u0027s strategy borrows from the trend toward \u0027\u0027\u0027entertailing\u0027\u0027\u0027, which combines retailing with entertainment\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Richard W. Oliver, \u0027The shape of things to come\u0027 (page 141\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Not all \u0027\u0027entertailing\u0027\u0027 is sports-focused\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Norman M. Scarborough, Thomas Zimmerer, \u0027Effective small business management: an entrepreneurial approach\u0027 (page 197\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The primary goal of \u0027\u0027entertailing\u0027\u0027 is to catch customers\u0027 attention and engage them in some kind of entertaining experience so that they shop longer and buy more goods or services\", \"priority\":7}]}, \"synonyms\":{}}");

	add("entertain", "{\"term\":\"entertain\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027entretenir\u0027 from \u0027entre\u0027 (among) + \u0027tenir\u0027 (to hold) from Latin \u0027inter\u0027 + {{m|la|teneō||hold, keep}}. For the noun, compare French \u0027entretien\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"entertainmen\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Entertainment; pleasure\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Reception of a guest; welcome\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1596\u0027\u0027, \u0027The Faerie Queene\u0027, IV.8\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"But neede, that answers not to all requests, / Bad them not looke for better \u0027\u0027entertayne\u0027\u0027 […\", \"priority\":5}]}, \"synonyms\":{}}");

	add("entertainer", "{\"term\":\"entertainer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|entertain|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who entertains others, esp. as a profession, as a singer, dancer, musician, comedian, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone who puts on a show for the entertainment or enjoyment of others\", \"priority\":2}]}, \"synonyms\":{}}");

	add("entertainment", "{\"term\":\"entertainment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027entretenement\u0027 see \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An activity designed to give pleasure, enjoyment, diversion, amusement, or relaxation to an audience, no matter whether the audience participates passively as in watching opera or a movie, or actively as in games\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a show put on for the enjoyment or amusement of other\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"maintenance or suppor\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Admission into service; service\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Payment of soldiers or servants; wages\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"w:Sir John Sir John Davie\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027entertainment\u0027\u0027 of the general upon his first arrival was but six shillings and eight pence\", \"priority\":7}]}, \"synonyms\":{}}");

	add("entextualisation", "{\"term\":\"entextualisation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A process of formal study of writings, removing texts from their context thus rendering them coherent, effective and memorable\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1996:\u0027\u0027 H S Pyper, \u0027David As Reader: 2 Samuel 12:1-15 and the Poetics of Fatherhood\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It is in the \u0027\u0027entextualisation\u0027\u0027 of the perlocutionary aspect of his reaction to the woman\u0027s speeches that we will find the answer\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2000:\u0027\u0027 Hugh R. Trappes-Lomax (editor), \u0027Change and Continuity in Applied Linguistics\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The key words here are \u0027\u0027entextualisation\u0027\u0027, transposition and recontextualisation\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005:\u0027\u0027 David F. Ford, Ben Quash, Janet Martin Soskice (editors), \u0027Fields of Faith: Theology and Religious Studies for the Twenty-first Century\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Texts...taken out of one context (\u0027\u0027entextualisation\u0027\u0027) which is a simultaneous placing in a new context (contextualisation\", \"priority\":7}]}, \"synonyms\":{}}");

	add("enthalpy", "{\"term\":\"enthalpy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἐνθάλπω\u0027 (to warm in)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In thermodynamics, a measure of the heat content of a chemical or physical system\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"lt;math\u0026gt; H \u003d U + p V \u0026lt;/math\u0026gt;, where \u0027H\u0027 is \u0027\u0027enthalpy\u0027\u0027, \u0027U\u0027 is internal energy, \u0027p\u0027 is pressure, and \u0027V\u0027 is volume\", \"priority\":2}]}, \"synonyms\":{}}");

	add("enthesis", "{\"term\":\"enthesis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἔνθεσις\u0027 (putting in, insertion)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The point at which a tendon, ligament, or muscle inserts into a bone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Erbil Ünsal, \u0027Chapter II: Andersson Lesion in Early Juvenile Spondyloarthropathies\u0027, Frank Columbus (editor), \u0027Focus On Arthritis Research\u0027, %22entheses%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d1Qgy-lGNzX\u0026amp;sig\u003dS2hk8SIkLC_FP7EK-yvlWDFnXEI\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003drg2AUNuxO4uViQfP54CgCA\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22entheses%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 26\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Like arthritis, peripheral enthesitis occurs predominantly in the lower extremities, particularly in the foot, at single sites at onset, and then at several \u0027\u0027entheses\u0027\u0027 throughout the course of the disease\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Philip Helliwell, James Woodburn, \u0027The Foot And Ankle in Rheumatoid Arthritis: A Comprehensive Guide\u0027, %22entheses%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dMmXepCZtEv\u0026amp;sig\u003dRT1IiMbgxtXc7W38IbL4zFRAQc4\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003drg2AUNuxO4uViQfP54CgCA\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"%22entheses%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 64\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Functional \u0027\u0027entheses\u0027\u0027 occur where tendinous and ligamentous structures, while not actually attaching to bone, are adjacent and in a close relationship to the underlying bone\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Richard J. Wakefield, Maria Antonietta D′Agostino, \u0027Essential Applications of Musculoskeletal Ultrasound in Rheumatology\u0027, %22entheses%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003doJNsd-ZEv7\u0026amp;sig\u003dTm8DuO6klJRfoKO79BHEpugdBOo\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003drg2AUNuxO4uViQfP54CgCA\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"%22entheses%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 211\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Inflammation of the \u0027\u0027enthesis\u0027\u0027, when associated with arthritis in children, is called the syndrome of seronegative enthesopathy associated with arthritis (SEA). The \u0027\u0027entheses\u0027\u0027 most commonly involved in children are the plantar aponeurosis, calcaneal \u0027\u0027enthesis\u0027\u0027, and distal and proximal patellar ligament insertions\", \"priority\":10}]}, \"synonyms\":{}}");

	add("enthesitis", "{\"term\":\"enthesitis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An inflammatory disorder of entheses (bone attachments\", \"priority\":1}]}, \"synonyms\":{}}");

	add("enthronement", "{\"term\":\"enthronement\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|enthrone|ment|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of enthroning or the state of being enthroned\", \"priority\":1}]}, \"synonyms\":{}}");

	add("enthusiasm", "{\"term\":\"enthusiasm\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\"], \"text\":\"First attested from w:1603|1603, from Middle french (ca. 1400-1600) {{m|frm|enthousiasme}}, from {{m|la|enthusiasmus}}, from Ancient greek (to 1453) {{m|grc|ἐνθουσιασμός}}, from {{m|grc|ἔνθεος||possessed by god\u0027s}} {{m|grc|ουσία||essence}}, from {{m|grc|ἐν||in}} + {{m|grc|θεός||god}} + {{m|grc|ουσία||essence}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Possession by a god; divine inspiration or frenzy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1946\u0027\u0027, Bertrand Russell, \u0027History of Western Philosophy\u0027, ch\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The intoxication that they sought was that of ‘\u0027\u0027enthusiasm\u0027\u0027’, of union with the god\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Intensity of feeling; excited interest or eagerness\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Something in which one is keenly interested\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027, \u0027Central States Archaeological Journal\u0027 (volumes 15-16, page 154\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"My main \u0027\u0027enthusiasm\u0027\u0027 is attending and seeing the progress and interest of collectors, to meet old friends, and hopefully to make new friends\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Nicholas Joll, \u0027Philosophy and The Hitchhiker\u0027s Guide to the Galaxy\u0027 (page 23\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Other Adamsian \u0027\u0027enthusiasms\u0027\u0027 included: fast cars; restaurants; Bach, the Beatles, Pink Floyd and Dire Straits\", \"priority\":9}]}, \"synonyms\":{}}");

	add("enticingness", "{\"term\":\"enticingness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|enticing|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being enticing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1915\u0027\u0027, Jack London, \u0027The Little Lady of the Big House\u0027 (page 24\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Not until our girl-children cease from playing with dolls and from looking at their own \u0027\u0027enticingness\u0027\u0027 in mirrors, will woman ever be otherwise than what she has always been: first, the mother, second, the mate of man\", \"priority\":3}]}, \"synonyms\":{}}");

	add("entirety", "{\"term\":\"entirety\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"wholeness; fullness; the whole\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Due the the early rainout, the game will be replayed in its \u0027\u0027entirety\u0027\u0027 on Friday\", \"priority\":2}]}, \"synonyms\":{}}");

	add("entitledness", "{\"term\":\"entitledness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|entitled|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of feeling entitled, convinced of one\u0027s own deservingness or superiority, and of shifting blame and responsibility to others; demandingness; pretense\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, Zeev Ben-Sira, \u0027Politics and primary medical care: dehumanization and overutilization\u0027, Gower Pub C\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Particularly striking is the fact that almost all (97 X) Labor fund P.C.P.s blame the system for creating a sense of \u0027\u0027entitledness\u0027\u0027 — a trend evidently conforming with the Labor fund members\u0027 greater likelihood to attribute the responsibility for their health to the fund and the physician (cf. pp.42-48\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Jeannette Angell, \u0027The Illusionist\u0027, iUniverse (ISBN 9780595096817), page 30\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“Shut up,” she said. “Just shut up, Victor. We\u0027re all going through a hard time, and I\u0027m getting a little damned tired of your \u0027\u0027entitledness\u0027\u0027. If Monsieur de Saint—Pierre says that Albert wrote it, then I am prepared to accept that. I suggest that you either do the same, or leave\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Carl E. Braaten, Robert W. Jenson, \u0027Sin, Death, and the Devil\u0027, Wm. B. Eerdmans Publishing (ISBN 9780802846952), page 4\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The attitude of the beloved is never one of merit or \u0027\u0027entitledness\u0027\u0027: \u0026quot;I had this coming,\u0026quot; but precisely the opposite: \u0026quot;I don\u0027t deserve this.\u0026quot; As the poets are well aware, the beloved never feels worthy of the advances of the lover\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Stuart Carr, Mac MacLachlan, Eilish McAuliffe, \u0027Psychology of Aid\u0027, Routledge (ISBN 9781134767090\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Figure 11.1 pictures this process of perceived need gradually deteriorating into outright \u0027Pay Me!\u0027 Aid officials the world over have in the past reported that a sustained flow of aid eventually results in a culture of \u0026amp\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"39;\u0027\u0027entitledness\u0027\u0027\u0026amp\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"39; (Gergen and Gergen, 1971\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Anthony Giardina, \u0027White Guys: A Novel\u0027, Macmillan (ISBN 9781429930581\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"“It\u0027s okay for me to be here, isn\u0027t it?” he asked, as though there could be no reason why he should be asked to leave. He went on eating, and I couldn\u0027t help, in the midst of the discomfort I knew I should be feeling—and did feel, though only a little—a faint amusement at his \u0027\u0027entitledness\u0027\u0027. It had never been a problem for him at Winerip, not from the beginning: the parties and the Boston caterers and the good poured champagne\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Anthony Giardina, \u0027Norumbega Park: A Novel\u0027, Macmillan (ISBN 9781429950015\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"All the boys seemed to be working hard to affect the louche attitude, the “Under My Thumb” air of sexual \u0027\u0027entitledness\u0027\u0027, the thatchy, unkempt hair of a young Mick Jagger\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Susan Miller, \u0027Shame in Context\u0027, Routledge (ISBN 9781134891948), page 11\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"constant focus on his self-image, his notion of being special (set apart from others and superior to them), and the associated insistence that ordinary rules of reality did not pertain to him. At times, there was a hostile \u0027\u0027entitledness\u0027\u0027 about him\", \"priority\":17}]}, \"synonyms\":{}}");

	add("entitlement", "{\"term\":\"entitlement\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|entitle|ment|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The right to have something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"power, authority to do somethin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Something that one is entitled to\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A legal obligation on a government to make payments to a person, business, or unit of government that meets the criteria set in law, such as social security in the US\", \"priority\":4}]}, \"synonyms\":{}}");

	add("entity", "{\"term\":\"entity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Medieval Latin \u0027entitas\u0027, from Latin, present participle of \u0027esse\u0027, \u0026quot;to be\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which has a distinct existence as an individual unit. Often used for organisations which have no physical form\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It is also pertinent to note that the current obvious decline in work on holarctic hepatics most surely reflects a current obsession with cataloging and with nomenclature of the organisms—as divorced from their study as living \u0027\u0027entities\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An existent something that has the properties of being real, and having a real existence\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Anything about which information or data can be stored in a database; in particular, an organised array or set of individual elements or parts\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being or existence\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The group successfully maintains its tribal entity\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Quotation:\u0027\u0027 The policy of the government of the United States is to seek . . . to preserve Chinese territorial and administrative \u0027entity\u0027 -- Wikipedia:George F. G.F.Kennan\", \"priority\":7}]}, \"synonyms\":{}}");

	add("entoblast", "{\"term\":\"entoblast\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|ento|blast|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the embryonic blastomeres that develop into the endoderm\", \"priority\":1}]}, \"synonyms\":{}}");

	add("entomology", "{\"term\":\"entomology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027entomologie\u0027 from Ancient greek (to 1453) \u0027ἔντομον\u0027 (insect) + \u0027-logie\u0027 (from Ancient greek (to 1453) \u0027-λογία\u0027 (-logy) .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The scientific study of insects\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Entomology\u0027\u0027 is an important field of study within biology\", \"priority\":2}]}, \"synonyms\":{}}");

