	add("entourage", "{\"term\":\"entourage\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"{{borrowing|fr|entourage|lang\u003den}}, from \u0027entourer\u0027 (to surround)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A retinue of attendants, associates or followers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A binary relation in a uniform space which generalises the notion of two points being no farther apart than a given fixed distance; a uniform neighbourhood\", \"priority\":2}]}, \"synonyms\":{}}");

	add("entry", "{\"term\":\"entry\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027entree\u0027 (feminine past participle of the verb \u0027entrer\u0027 Modern French \u0027entrée\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of entering\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Permission to enter\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"entry \u0027\u0027for\u0027\u0027 children only if accompanied by an adult\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A doorway that provides a means of entering a building\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A small room immediately inside the front door of a house or other building, often having an access to a stairway and leading on to other room\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A small group formed within a church, especially Episcopal, for simple dinner and fellowship, and to help facilitate new friendship\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An item in a list, such as an article in a dictionary or encyclopedia; a record made in a log, diary or anything similarly organized; a datum in a database\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"What does the entry for 2 August 2005 say\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A term at any position in a matrix\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The entry in the second row and first column of this matrix is 6\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The exhibition or depositing of a ship\u0027s papers at the customhouse, to procure licence to land goods; or the giving an account of a ship\u0027s cargo to the officer of the customs, and obtaining his permission to land the goods\", \"priority\":11}]}, \"synonyms\":{}}");

	add("entrails", "{\"term\":\"entrails\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Old french (842-ca. 1400) \u0027entrailles\u0027 \u0026lt; \u0027intralia\u0027 from Latin \u0027interanea\u0027 from \u0027interaneus\u0027 from \u0027inter\u0027 Compare Spanish \u0027entraña\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The internal organs of an animal, especially the intestines\", \"priority\":1}]}, \"synonyms\":{}}");

	add("entreat", "{\"term\":\"entreat\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027entretier\u0027 from Old french (842-ca. 1400) \u0027entraiter\u0027 from \u0027en-\u0027 + \u0027traiter\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Khaled Abou El Fadl, \u0027The Search for Beauty in Islam: A Conference of the Books\u0027,\u0026lt;sup \u0026gt;[http://books.google.com/books?id\u003dRzzlj9K9KXYC ]\u0026lt;/sup\u0026gt; Rowman \u0026amp;amp; Littlefield, ISBN 978-0-7425-5094-0, page 236\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In the Muslim world, the most compelling and decisive books are those full of confessions written on the flesh of victims, and the most earnest prayers are the \u0027\u0027entreats\u0027\u0027 for mercy screamed in pain and anguish at the tormentors and flesh and thought\", \"priority\":2}]}, \"synonyms\":{}}");

	add("entreaty", "{\"term\":\"entreaty\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of entreating or beseeching; urgent prayer; earnest petition; pressing solicitation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We need an \u0027\u0027entreaty\u0027\u0027 to stop the hostilities\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A treatment; reception; entertainment\", \"priority\":3}]}, \"synonyms\":{}}");

	add("entrelac", "{\"term\":\"entrelac\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"French\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A knitting technique used to create a textured diamond pattern, comprising interconnected squares on two different orientations\", \"priority\":1}]}, \"synonyms\":{}}");

